proc GetBishopAttacksFast(startingSquare: int, occupancy: uint64) : uint64 = #{

    var maskedOccupancy = occupancy and BISHOP_MASKS[startingSquare]
    maskedOccupancy *= BISHOP_MAGIC_NUMBERS[startingSquare]
    maskedOccupancy = maskedOccupancy shr (64 - BISHOP_REL_BITS[startingSquare])
    return BISHOP_ATTACKS[startingSquare][maskedOccupancy]
#}

proc GetRookAttacksFast(startingSquare: int, occupancy: uint64) : uint64 = #{

    var maskedOccupancy = occupancy and ROOK_MASKS[startingSquare]
    maskedOccupancy *= ROOK_MAGIC_NUMBERS[startingSquare]
    maskedOccupancy = maskedOccupancy shr (64 - ROOK_REL_BITS[startingSquare])
    return ROOK_ATTACKS[startingSquare][maskedOccupancy]
#}

