            #}

            #captures
            tempCaptures = tempAttack and BLACK_OCCUPANCIES;
            while tempCaptures != 0: #{

                targetSquare = BitscanForward(tempCaptures)
                tempCaptures = tempCaptures and tempCaptures - 1

                if (pieceArray[BP] and WHITE_PAWN_ATTACKS[targetSquare]) != 0: #{
                    continue
                #}
                if (pieceArray[BN] and KNIGHT_ATTACKS[targetSquare]) != 0: #{
                    continue
                #}
                if (pieceArray[BK] and KING_ATTACKS[targetSquare]) != 0: #{
                    continue
                #}
                let bishopAttacks: uint64 = GetBishopAttacksFast(targetSquare, occupanciesWithoutWhiteKing);
                if (pieceArray[BB] and bishopAttacks) != 0: #{
                    continue
                #}
                if (pieceArray[BQ] and bishopAttacks) != 0: #{
                    continue
                #}
                let rookAttacks: uint64 = GetRookAttacksFast(targetSquare, occupanciesWithoutWhiteKing);
                if (pieceArray[BR] and rookAttacks) != 0: #{
                    continue
                #}
                if (pieceArray[BQ] and rookAttacks) != 0: #{
                    continue
                #}

                moveList[moveCount][MOVE_STARTING] = whiteKingPosition;
                moveList[moveCount][MOVE_TARGET] = targetSquare;
                moveList[moveCount][MOVE_TAG] = TAG_CAPTURE;
                moveList[moveCount][MOVE_PIECE] = WK;
                moveCount+=1;
            #}

            if whiteKingCheckCount == 0: #{

                if castleRights[WKS_CASTLE_RIGHTS] == true: #{

                    if whiteKingPosition == E1: #{ #king on e1

                        if (WKS_EMPTY_BITBOARD and COMBINED_OCCUPANCIES) == 0: #{ #f1 and g1 empty

                            if (pieceArray[WR] and SQUARE_BBS[H1]) != 0: #{ #rook on h1

                                if Is_Square_Attacked_By_Black(F1, COMBINED_OCCUPANCIES) == false: #{

                                    if Is_Square_Attacked_By_Black(G1, COMBINED_OCCUPANCIES) == false: #{

