                    for i in 0..<pinNumber: #{
                        if pinArray[i][PINNED_SQUARE_INDEX] == startingSquare: #{

                            tempPinBitboard = INBETWEEN_BITBOARDS[whiteKingPosition][pinArray[i][PINNING_PIECE_INDEX]];
                        #}
                    #}
                #}

                if (SQUARE_BBS[startingSquare-8] and COMBINED_OCCUPANCIES) == 0: #{ #if up one square is empty

                    if ((SQUARE_BBS[startingSquare-8] and checkBitboard) and tempPinBitboard) != 0: #{

                        if (SQUARE_BBS[startingSquare] and RANK_7_BITBOARD) != 0: #{ #if promotion

